import styled from 'styled-components';

export default function Landing (props) {


    return (
        // Render the Pizza component 
        <div> 
            <StyledBanner>
                <div className='image-wrapper'> 
                    <img className='banner-logo' src='https://i0.wp.com/pointofsale.com/wp-content/uploads/2020/05/DOORDASH-LOGO-01.png?w=2084&ssl=1' alt='doordash'/> 
                </div>
                <p> Place a quick order from the nearest restaurant </p>
                <Router>
                    <Link to='/pizza'>
                        <div className='buttons-container'> 
                        <Button color='primary' className='quick-order' id='pizza'>
                            Pizza 
                        </Button>
                        </div>
                    </Link>
                    <Route path='/pizza' component={Pizza} />
                </Router>
            </StyledBanner>
            {/* <Restaurants /> */}

        </div>

    )

const StyledBanner =styled.div `
/* border: green 2px dashed; */
margin-top: 20px;    
max-width: 100%;
display: flex;
flex-flow: column;
justify-content: center;
align-items: center;

    .image-wrapper{
        display: flex;
        justify-content: center;
        align-items: center;
        max-width: 40%;
    }
    .banner-logo{
        max-width: 100%;
    }
    .buttons-container {
        display: flex;
        min-width: 40%;
        justify-content: center;
    }
    .quick-order{
        min-width: 100px;
    }
    p{
        margin-top: 10px;
    }
`
};
